import React from 'react';
import ReactDOM from 'react-dom';
import s from './App.module.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let Ord_Shoop = [
    { class: s.nav1, path: "Buy_subscription", name: "Заказ" },
    { class: s.nav2, path: "test2", name: "БД" },
    { class: s.nav3, path: "kk", name: "КК" },
    { class: s.nav4, path: "ord", name: "Оформление" },
    { class: s.nav5, path: "kontakt", name: "Контакты" },
    { class: s.nav6, path: "time_work", name: "Время работы" },
    { class: s.nav7, path: "books", name: "Буквы" },
]
ReactDOM.render(<App  Ord_Shoop={Ord_Shoop}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
